import React from "react";
import "../resource/styles/detailmessageuser.css";
import arownBack from "../resource/svg/chat/message/message/detailMessageUser/arownBack.svg";
import addGroup from "../resource/svg/chat/message/message/detailMessageUser/groupAdd.svg";
import avatar from "../resource/img/avatar.png";
import search from "../resource/svg/chat/message/message/detailMessageUser/search.svg";
import webcame from "../resource/svg/chat/message/message/detailMessageUser/webcame.svg";
import more from "../resource/svg/chat/message/more.svg";
import sticker from "../resource/svg/chat/message/message/detailMessageUser/sticker.svg";
import image from "../resource/svg/chat/message/message/detailMessageUser/image.svg";
import attach from "../resource/svg/chat/message/message/detailMessageUser/attach.svg";
import screenCapture from "../resource/svg/chat/message/message/detailMessageUser/screenCapture.svg";
import businessCard from "../resource/svg/chat/message/message/detailMessageUser/businessCard.svg";
import clock from "../resource/svg/chat/message/message/detailMessageUser/clock.svg";
import toDoMission from "../resource/svg/chat/message/message/detailMessageUser/toDoMission.svg";
import chamthan from "../resource/svg/chat/message/message/detailMessageUser/chamthan.svg";

function DetailMessageUser() {
  const data_user = {
    username: "Kim Young Jung",
    lastTime: "3 giờ",
    timmer: "21:09 11/12/2023",
  };

  return (
    <>
      <div className="contains-interface">
        <div className="header-container flex">
          <div className="left-header flex">
            <div className="flex">
              <img className="right-icon-arowback" src={arownBack} alt="" />
              <img className="right-img-avatar" src={avatar} alt="" />
              <div className="user-infor">
                <h5>{data_user.username}</h5>
                <p>{`Truy cập ${data_user.lastTime} trước`}</p>
              </div>
            </div>
          </div>
          <div className="right-header flex">
            <img className="right-icon-group" src={addGroup} alt="add-group" />
            <img className="right-icon-search" src={search} alt="search" />
            <img className="right-icon-webcam" src={webcame} alt="webcam" />
          </div>
        </div>

        <div className="center-container"></div>

        <div className="footer-container">
          <div className="upper-footer flex">
            <img src={sticker} alt="" />
            <img src={image} alt="" />
            <img src={attach} alt="" />
            <img src={screenCapture} alt="" />
            <img src={businessCard} alt="" />
            <img src={clock} alt="" />
            <img src={toDoMission} alt="" />
            <img src={chamthan} alt="" />
          </div>
          <div className="lower-footer flex">
            <input
              type="text"
              placeholder={`Nhap @, tin nhắn tới ${data_user.username}`}
            />
          </div>
        </div>
      </div>
    </>
  );
}

export default DetailMessageUser;
